import React from 'react';
import Line from './Line';
import './App.css';

function Plateau(props) {
  const line = props.game.map ((element,index) =>{
    <Line></Line>
  })
  return (
    <div className="App">
          <div className="plateau">
            {line}
          </div>
    </div>
  );
}

export default Plateau;
